import { Divider, Table, TableBody, TableCell, TableColumn, TableHeader, TableRow } from "@nextui-org/react";
import { differenceInMinutes, format, parseISO } from "date-fns";
import React from "react";
import { FaWaze } from "react-icons/fa";
import { FaLocationDot, FaPhoneFlip } from "react-icons/fa6";

export const ShaotAobedHdbsa = React.forwardRef((props, ref) => {

    const shaot = props?.shaot;
    const aobed = props?.aobed;

    function flipDate(dateStr) {
        const [day, month, year] = dateStr.split('-');
        const flippedDateStr = `${year}-${month}-${day}`;
        return flippedDateStr;
    }

    function GetTarekhShem(val) {
        if (val === 'Sunday') {
            return 'ראשון';
        }
        else if (val === 'Monday') {
            return 'שני';
        }
        else if (val === 'Tuesday') {
            return 'שלשי';
        }
        else if (val === 'Wednesday') {
            return 'רבעי';
        }
        else if (val === 'Thursday') {
            return 'חמשי';
        }
        else if (val === 'Friday') {
            return 'שישי';
        }
        else if (val === 'Saturday') {
            return 'שבת';
        }
    }

    const calculateTimeDifference = (startTime, endTime) => {
        const [startHour, startMinute] = startTime.split(':').map(Number);
        const [endHour, endMinute] = endTime.split(':').map(Number);
        const startDate = new Date(0, 0, 0, startHour, startMinute);
        const endDate = new Date(0, 0, 0, endHour, endMinute);
        const diffMinutes = differenceInMinutes(endDate, startDate);
        const hours = Math.floor(diffMinutes / 60);
        const minutes = diffMinutes % 60;
        return format(new Date(0, 0, 0, hours, minutes), 'HH:mm');
    };

    function timeToDecimal(time) {
        const [hours, minutes] = time.split(":").map(Number);
        return hours + (minutes / 60);
      }

    const GetSkhomKolHshaot = () => {
        let sum = 0;
        for (let index = 0; index < shaot.length; index++) {
            if(shaot[index].knesa && shaot[index].yetseah){
                sum += parseFloat(timeToDecimal(calculateTimeDifference(shaot[index].knesa, shaot[index].yetseah)));
            }
        }
        return sum.toFixed(2);
    }



    return (
        <div ref={ref} className="bg-white p-10">
            <div className="flex justify-around items-center w-full">
                <div className="border-r-2 pl-5 pr-5 w-full flex justify-around items-center">
                    <div className="text-sm">
                        <div className="flex items-center">
                            <div className="w-[100px] text-right">050-909-9989</div>
                            <div className="flex items-center"><FaPhoneFlip className="ml-2 text-base w-[30px]" /></div>
                        </div>
                        <div className="flex items-center mt-2">
                            <div className="w-[100px] text-right">ערערה גביש 65</div>
                            <div className="flex items-center"><FaLocationDot className="ml-2 text-xl w-[30px]" /></div>
                        </div>
                        <div className="flex items-center mt-2">
                            <div className="w-[100px] text-right">נגררי עירון 2020</div>
                            <div className="flex items-center"><FaWaze className="ml-2 text-xl w-[30px]" /></div>
                        </div>
                    </div>
                    <div className="ml-5">
                        <img className="w-[150px] h-[75px]" src='data:image/jpeg;base64,' />
                    </div>
                    <div className="text-sm">
                        <div className="flex items-center">
                            <div className="w-[180px] text-right">ייצור נגררים לפי תוכנית לקוח</div>
                            <div className="flex items-center"><div className="ml-2 text-base w-[30px]">*</div></div>
                        </div>
                        <div className="flex items-center mt-2">
                            <div className="w-[180px] text-right">שיפוץ ותיקון נגררים</div>
                            <div className="flex items-center"><div className="ml-2 text-base w-[30px]">*</div></div>
                        </div>
                        <div className="flex items-center mt-2">
                            <div className="w-[180px] text-right">התקנת וו גרירה</div>
                            <div className="flex items-center"><div className="ml-2 text-base w-[30px]">*</div></div>
                        </div>
                    </div>
                </div>
                <div className="text-base font-bold text-center max-w-[150px] w-full">
                    דף שעות עבודה
                </div>
            </div>
            <Divider className="mt-3 mb-3 h-[3px] bg-gray-500" />
            <div className="flex items-center justify-between" dir="rtl">
                <div>
                    <div className="flex items-center">
                        <div className="w-[100px]">שם עובד</div>
                        <div className="w-[100px]">{aobed?.shem}</div>
                    </div>
                    <div className="flex items-center">
                        <div className="w-[100px]">ת.ז</div>
                        <div className="w-[100px]">{aobed?.taodatZhot}</div>
                    </div>

                </div>
                <Divider className="w-[1px] h-[50px]" />
                <div>
                    <div className="flex items-center">
                        <div className="w-[100px]">נייד</div>
                        <div className="w-[100px]">{aobed?.nead}</div>
                    </div>
                    <div className="flex items-center">
                        <div className="w-[100px]">ישוב</div>
                        <div className="w-[100px]">{aobed?.yeshov}</div>
                    </div>
                </div>
                <Divider className="w-[1px] h-[50px]" />
                <div>
                    <div className="flex items-center">
                        <div className="w-[100px]">תאריך</div>
                        <div className="w-[100px]">{format(new Date(), 'dd-MM-yyyy')}</div>
                    </div>
                    <div className="flex items-center">
                        <div className="w-[100px]">תפקיד</div>
                        <div className="w-[100px]">{aobed?.tfked}</div>
                    </div>
                </div>
            </div>
            <div className="mt-14">
                <Table>
                    <TableHeader>
                        <TableColumn className="text-right text-sm border-b-2">סכום שעות</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">יצאה</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">כניסה</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">היעדרות</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">תאריך</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">יום</TableColumn>
                        <TableColumn className="text-right text-sm border-b-2">מס'</TableColumn>
                    </TableHeader>
                    <TableBody>
                        {
                            shaot?.map((shaa, index) => {
                                return <TableRow>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{shaa?.knesa && shaa?.yetseah && parseFloat(timeToDecimal(calculateTimeDifference(shaa?.knesa, shaa?.yetseah))).toFixed(2)}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{shaa?.yetseah}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{shaa?.knesa}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{shaa?.headrot || ((shaa.knesa && shaa.yetseah) ? 'נוכח' : '')}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{shaa.yom}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{GetTarekhShem(format(flipDate(shaa?.yom), 'EEEE'))}</TableCell>
                                    <TableCell className={`text-right border-b-1 ${shaa.knesa && !shaa.yetseah ? 'text-danger' : ''}`}>{index + 1}</TableCell>
                                </TableRow>
                            })
                        }
                        <TableRow>
                            <TableCell className="text-right">{GetSkhomKolHshaot()}</TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                            <TableCell></TableCell>
                        </TableRow>
                    </TableBody>
                </Table>
            </div>
        </div>
    )
})
